import React from "react";
import HeaderLogedin from "../components/headerLogedin";
import { Box, Divider, Paper } from "@mui/material";
import Grid from "@mui/material/Grid";

export default function Profile(params) {
  const ContainerStyle = {
    marginTop: "20px",
    marginBottom: "50px",
    padding: "30px",
    backgroundColor: "custom.main",
  };
  const ColumnStyle = {
    height: "100%",
    backgroundColor: "white",
    borderRadius: "3px",
  };
  return (
    <>
      <HeaderLogedin />
      <Divider sx={{ marginTop: "80px" }} />
      <Paper sx={ContainerStyle} elevation={2}>
        <Grid sx={{ height: "600px" }} container spacing={2}>
          <Grid item xs={6} md={9}>
            <Box sx={ColumnStyle}>xs=6 md=9</Box>
          </Grid>
          <Grid item xs={6} md={3}>
            <Box sx={ColumnStyle}>xs=6 md=3</Box>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
}
